import React, { useState } from "react";
import LaunchMaxInput from "../MaxLaunch/MaxLaunchInput";
import LaunchMinInput from "../LaunchMin/LaunchMinInput";
import CountrySelect from "../CountrySelect/CountrySelect";
import ManufacturerSelect from "../ManufacturerSelect/ManufacturerSelect";
import SortOrderSelect from "../SortOrderSelect/SortOrderSelect";

const SortForm = ({ onSort }) => {
  const [launchMax, setLaunchMax] = useState("");
  const [launchMin, setLaunchMin] = useState("");
  const [country, setCountry] = useState("");
  const [manufacturer, setManufacturer] = useState("");
  const [sortOrder, setSortOrder] = useState("");

  const handleSort = (e) => {
    e.preventDefault();

    const sortParams = {
      launchMax: launchMax || undefined,
      launchMin: launchMin || undefined,
      country: country || undefined,
      manufacturer: manufacturer || undefined,
      order: sortOrder || undefined,
    };

    onSort(sortParams);
  };

  return (
    <form onSubmit={handleSort}>
      <LaunchMaxInput
        value={launchMax}
        onChange={(e) => setLaunchMax(e.target.value)}
      />
      <LaunchMinInput
        value={launchMin}
        onChange={(e) => setLaunchMin(e.target.value)}
      />
      <CountrySelect
        value={country}
        onChange={(e) => setCountry(e.target.value)}
      />
      <ManufacturerSelect
        value={manufacturer}
        onChange={(e) => setManufacturer(e.target.value)}
      />
      <SortOrderSelect
        value={sortOrder}
        onChange={(e) => setSortOrder(e.target.value)}
      />
      <button type="submit">Sort</button>
    </form>
  );
};

export default SortForm;
